import thecircletop from "../images/thecircletop.png"
import productive from "../images/productive.png"
// import lgbtq from "../images/lgbtq.jpg"
// import startups from "../images/startups.jpeg"
// import vacation from "../images/vacation.jpeg"
import Runnerups from "./Runnerups"
import Topstory from "./Topstory"


const Presenting = () => {
    return (
        <div className='presenting-body'>
            <Topstory image={thecircletop} 
                      title='New Waterfall? Or forgotten lands?' 
                      subtitle='Guyanese pilot discovered unknown Waterfall in the land of many waters' 
                      author='Stephon Fraser'
            />
            <div className='runner-ups'>
                <Runnerups title='7 Ways to Be More Productive' author='Sarah Jones' image={productive} />
                <Runnerups title='LGBTQ+ Life in Guyana' author='Jason Dawn' image=''/>
                <Runnerups title='Startups Rocking the Caribbean' author='Claire Jean' image=''/>
                <Runnerups title='Best Vacation Spots in Guyana' author='France Richards' image=''/>
            </div>
        </div>
    )
}

export default Presenting
